import logo from "./logo.svg";
import Users from "./components/Users";
import "./App.css";

function App() {
  return (
    <div className="container-fluid">
      <nav>
        <div className="nav-wrapper center-align">
          <a href="/" className="brand-logo"></a>
        </div>
      </nav>
      <Users></Users>
    </div>
  );
}

export default App;
